import React from 'react';
import { render, screen } from '@testing-library/react';
import '@testing-library/jest-dom/extend-expect';
import AlertView from '../Alert/View';
import configureStore from 'redux-mock-store';
import { Provider } from 'react-intl-redux';
import thunk from 'redux-thunk';

const middlewares = [thunk];
const mockStore = configureStore(middlewares);

const mock_fields = {
  '@type': 'alert',
  bg_color: 'warning',
  image: {
    'content-type': 'image/jpeg',
    data: '',
    encoding: 'base64',
    filename: 'insalata-1280x720.jpeg',
  },
  text: {
    blocks: [
      {
        data: {},
        depth: 0,
        entityRanges: [],
        inlineStyleRanges: [],
        key: 'ctqrv',
        text: 'Ciao',
        type: 'unstyled',
      },
    ],
    entityMap: {},
  },
};

const store = mockStore({
  intl: {
    locale: 'en',
    messages: {},
  },
});

test('View renders all fields', async () => {
  render(
    <Provider store={store}>
      <AlertView data={mock_fields} />
    </Provider>,
  );

  //title
  expect(screen.getByText(/Ciao/i)).toBeInTheDocument();

  //immagine
  const images = document.getElementsByClassName('left-image');
  expect(images.length).toBe(1);

  //sfondo
  const alertBox = document.getElementsByClassName('full-width');
  expect(alertBox[0]).toHaveClass('bg-alert-warning');
});
